import React from "react";


const Navbar = () => {



    return (
        <div className="wrapper">
            <div className="navbar-content">
                <button>About</button>
                <button>Projects</button>
                <button>Resume</button>
                <button>Contact</button>
            </div>
        </div>
    )
}

export default Navbar;
